CREATE DEFINER=`cpirizito`@`%` FUNCTION `fn_ConvertToDateTime`(miDatetime BIGINT) RETURNS datetime
BEGIN

  DECLARE localTimeOffset BIGINT;
  declare adjustedLocalDatetime BIGINT;
  declare fechaRes datetime;

  SET localTimeOffset = TIMESTAMPDIFF(SECOND,now(),UTC_DATE());
  SET adjustedLocalDatetime = miDatetime - localTimeOffset;

  set fechaRes=(date_Add(CAST('1970-01-01 00:00:00' AS datetime), interval adjustedLocalDatetime second));

  RETURN fechaRes;
END ;;
