CREATE DEFINER=`cpirizito`@`%` FUNCTION `fn_DevolverIdDispositivoUsuario`(miUsuario varchar(256),miDispositivo VARCHAR(256)) RETURNS bigint
BEGIN

  declare _res bigint(20);
  declare _resCant integer;

  set _resCant=(select count(*) from Dispositivo_Usuario du inner join Dispositivo d on du.idDispositivo=d.id where idUsuario=miUsuario and d.serie=miDispositivo);

  set _res=(select case _resCant
    when 0 then
		-1
	else 
		du.id
  	end
  from
	Dispositivo_Usuario  du inner join Dispositivo d on du.idDispositivo=d.id where idUsuario=miUsuario and d.serie=miDispositivo);

  return _res;
end ;;
