CREATE DEFINER=`cpirizito`@`%` FUNCTION `fn_UsuarioMismoCliente`(mailPrincipal varchar(256),mailSecundario varchar(256)) RETURNS int
BEGIN

RETURN (select 
	count(*) as Cantidad
from 
	Mechabios.Cliente_Usuario
where idCliente in
(
SELECT idCliente FROM Mechabios.Cliente_Usuario
where idUsuario in(
select Id from AspNetUsers where UserName=mailPrincipal
))
and idUsuario in(
select Id from AspNetUsers where UserName=mailSecundario
)
or(mailPrincipal=mailSecundario));
END ;;
