CREATE DEFINER=`cpirizito`@`%` PROCEDURE `sp_devolverMensajesGraficas`(in idDispositivoUsuario bigint,in cantColumnas int,in cantRegistros int )
BEGIN
SET @_idDispositivoUsuario = idDispositivoUsuario;
SET @_cantColumnas = cantColumnas;
SET @_cantRegistros = cantRegistros;


SET @_select = '';
SET @_from= '';
SET @_where= '';
SET @_orderBy = '';
SET @_limit = '';
SET @_query = '';

SET @_indice = 1;
SET @_select = 'select ';
SET @_from= 'from Dispositivo_Usuario_Mensaje ';
SET @_where= 'where 1=1 ';
SET @_orderBy = 'order by fechaHoraCreacion ';
SET @_alias= NULL;
SET @_suma= 0;


    while (@_indice <= @_cantColumnas) do
		set @_alias=null;
        set @_suma=@_suma+@_indice;
		set @_alias= (select case when (fn_CampoColumna(@_idDispositivoUsuario,@_indice) is null) then '' else fn_CampoColumna(@_idDispositivoUsuario,@_indice) end);
		IF((not(@_alias IS NULL)) and (not(@_alias ='')))THEN	
			if(@_indice=1) then
				SET @_select=concat(@_select,' msgc' ,@_indice,' as ',@_alias,' ');		                         				
			else
				SET @_select=concat(@_select,', msgc' ,@_indice,' as ',@_alias,' ');	
			end if;
		END IF;      
        set @_indice=@_indice+1;    
    end while;
if(@_limit<>-1)then
	set @_limit=concat('limit 1,',@_cantRegistros);
end if;
set @_query=concat(@_select,', fechaHoraCreacion as Fecha ',@_from,@_where,@_orderBy,@_limit,' ;');
-- select @_query;


-- SET @_idDispositivoUsuario1 = idDispositivoUsuario1;
-- DROP TEMPORARY TABLE IF EXISTS tblCamposOrdenDispositivoUsuario_tmp;
-- CREATE TEMPORARY TABLE tblCamposOrdenDispositivoUsuario_tmp AS

-- SET @query := CONCAT('SELECT SUM(...) AS `', @column_alias1, '`, SUM(...) AS `', @column_alias2, '` FROM ...');
PREPARE dynamic_statement FROM @_query;
EXECUTE dynamic_statement;

END ;;
DELIMITER ;
