select a.*,ts.idUsuario,tn.descripcion,uc.id,uc.valor from Accion_Realizada a inner join vDispositivosUsuarios_SuscriptosAhora ts on a.idDispositivoUsuario=ts.idDispositivoUsuario inner join Usuario_Contacto uc on ts.idUsuario =uc.idUsuario inner join TipoNotificacion tn on uc.idTipoNotificacion=tn.id;    
END ;;
