CREATE DEFINER=`cpirizito`@`%` PROCEDURE `sp_devolverTablaCamposOrdenDispositivoUsuarioTblTmp`(in idDispositivoUsuario1 bigint)
BEGIN

  SET @_idDispositivoUsuario1 = idDispositivoUsuario1;


  DROP TEMPORARY TABLE IF EXISTS tblCamposOrdenDispositivoUsuario_tmp;
  CREATE TEMPORARY TABLE tblCamposOrdenDispositivoUsuario_tmp AS

  select
    Nombre,
    idColumna,
    ordenColumna,
    cols.campo as Etiqueta
  from
    (
      SELECT
        column_name as Nombre,
        ordinal_position as idColumna,
        ordinal_position as ordenColumna
      FROM
        INFORMATION_SCHEMA.COLUMNS
      where table_schema='Mechabios' and table_name='Dispositivo_Usuario' and column_name like 'campo%'
    ) s
    left join
    (
      select campo1 as Campo,8 as orden from Dispositivo_Usuario where id=@_idDispositivoUsuario1
      union all
      select campo2,9 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
  	  union all
      select campo3,10 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
      union all
      select campo4,11 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
      union all
      select campo5,12 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
      union all
      select campo6,13 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
      union all
      select campo7,14 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
      union all
      select campo8,15 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
      union all
      select campo9,16 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
      union all
      select campo10,17 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
      union all
      select campo11,18 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
      union all
      select campo12,19 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
      union all
      select campo13,20 from Dispositivo_Usuario where id=@_idDispositivoUsuario1
    )cols on s.ordenColumna=cols.orden
    order by 2;

end ;;
DELIMITER ;
