CREATE DEFINER=`cpirizito`@`%` PROCEDURE `sp_DevolverValorUsadoTmp`(in miIdDispositivoUsuario bigint,in miCantRegTomar bigint,in miColumna long)
BEGIN

    declare _cantRegTomar bigint;
    declare _idDispositivoUsuario1 bigint;
    declare _columna bigint;
    set _cantRegTomar=miCantRegTomar;
    set _idDispositivoUsuario1 =miIdDispositivoUsuario;
    set _columna =miColumna;

    drop temporary table if exists tblPromedioDispositivosUsuariosMensajes_tmp;
    create temporary table tblPromedioDispositivosUsuariosMensajes_tmp
    (
      valor varchar(100)
    );
    
    
    insert into tblPromedioDispositivosUsuariosMensajes_tmp select cast(CASE _columna when 1 THEN msgc1 WHEN 2 THEN msgc2 WHEN 3 THEN msgc3 WHEN 4 THEN msgc4 WHEN 5 THEN msgc5 WHEN 6 THEN msgc6 WHEN 7 THEN msgc7 WHEN 8 THEN msgc8 WHEN 9 THEN msgc9 WHEN 10 THEN msgc10 WHEN 11 THEN msgc11 WHEN 12 THEN msgc12 WHEN 13 THEN msgc13 END as decimal(18,10)) from Dispositivo_Usuario_Mensaje where idDispositivoUsuario=_idDispositivoUsuario1 order by id desc limit _cantRegTomar;

end ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
