CREATE DEFINER=`cpirizito`@`%` PROCEDURE `sp_llenarNotificacionesAcciones`()
BEGIN

	
    declare _DispositivosUsuariosIdDispositivoUsuario bigint;
	declare _DispositivosUsuariosContador bigint;
	declare _DispositivosUsuariosTotal bigint ;

	declare _NotificacionesIdNotificacion bigint;
	declare _NotificacionesContador bigint;
	declare _NotificacionesTotal bigint ;
	declare _NotificarRecepcion bit;
	declare _NotificarMinimo bit;
	declare _NotificarMaximo bit;
	declare _PromedioValorUsado decimal(18,10);
	declare _NotificacionesColumna int;
	declare _idDispositivoUsuario1 bigint ;
	declare _cantRegistrosTomar1 bigint;
	declare _ValorMaximo decimal(18,10);
	declare _ValorMinimo decimal(18,10);

	
	drop temporary table if exists tblAvisar_tmp;
	create temporary table tblAvisar_tmp
	(
		idDispositivoUsuario bigint,
		idNotificacion bigint,
		campo varchar(256),
		valor varchar(256),
		chequearMinimo bit(1),
		chequearMaximo bit(1),
		chequearRecepcionDatos bit(1)
	);

	drop temporary table if exists tblMisDispositivosUsuarios_tmp;
	create temporary table tblMisDispositivosUsuarios_tmp
	(
		idDispositivoUsuario bigint
		,nombre varchar(256)
		,descripcion varchar(256)
		,latitud decimal(18,10)
		,longitud decimal(18,10)
		,elevacion integer
		,publico bit(1)
		,campo1 varchar(256)
		,campo2 varchar(256)
		,campo3 varchar(256)
		,campo4 varchar(256)
		,campo5 varchar(256)
		,campo6 varchar(256)
		,campo7 varchar(256)
		,campo8 varchar(256)
		,campo9 varchar(256)
		,campo10 varchar(256)
        ,campo11 varchar(256)
        ,campo12 varchar(256)
        ,campo13 varchar(256)
        ,idDispositivo bigint
		,idUsuario varchar(127)
		,fechaHoraDesde datetime
		,fechaHoraHasta datetime
		,activo bit(1)
	);

	insert into tblMisDispositivosUsuarios_tmp
	select * from vDispositivosUsuariosActivosAhora order by id;
    
    
	set _DispositivosUsuariosIdDispositivoUsuario= 0;
	set _DispositivosUsuariosContador = 0;
	set _DispositivosUsuariosTotal = ifnull((select count(*) from tblMisDispositivosUsuarios_tmp), 0);
    
    while (_DispositivosUsuariosContador <> _DispositivosUsuariosTotal) do

		set _DispositivosUsuariosIdDispositivoUsuario= (select idDispositivoUsuario from tblMisDispositivosUsuarios_tmp order by idDispositivoUsuario limit _DispositivosUsuariosContador,1);
		
        
		
        
		drop temporary table if exists tbl_MisNotificaciones_tbl;
		create temporary table tbl_MisNotificaciones_tbl
		(
			idNotificacion bigint
			,idDispositivoUsuario bigint
			,DispositivoUsuarioNotificacion varchar(256)
			,ColumnaChequear int
			,chequearPromedioRecibidos  bit(1)
			,cantidadValoresPromediar int
			,chequearMinimo bit(1)
			,valorMinimo varchar(256)
			,chequearMaximo bit(1)
			,valorMaximo varchar(256)
			,chequearRecepcionDatos bit(1)
			,minutosRecepcionDatos int
			,fechaHoraDesde datetime
			,fechaHoraHasta datetime
			,activo bit(1)
		);
		insert into tbl_MisNotificaciones_tbl
		SELECT * FROM vNotificacionesActivasAhora where idDispositivoUsuario=_DispositivosUsuariosIdDispositivoUsuario order by id,idDispositivoUsuario;
		
        set _NotificacionesIdNotificacion = 0;
		set _NotificacionesContador = 0;
		set _NotificacionesTotal = ifnull((select count(*) from tbl_MisNotificaciones_tbl), 0);
		set _NotificarRecepcion = 0;
		set _NotificarMinimo = 0;
		set _NotificarMaximo = 0;
			
		while (_NotificacionesContador <> _NotificacionesTotal) do
		
			set _NotificacionesIdNotificacion = (select idNotificacion from tbl_MisNotificaciones_tbl order by idNotificacion limit _NotificacionesContador,1);
			set _cantRegistrosTomar1 = (select cantidadValoresPromediar from tbl_MisNotificaciones_tbl order by idNotificacion limit _NotificacionesContador,1);
			set _NotificacionesColumna = (select ColumnaChequear from tbl_MisNotificaciones_tbl order by idNotificacion limit _NotificacionesContador,1);
			set _ValorMaximo = (select cast(valorMaximo as decimal(18,10)) as valorMaximo from tbl_MisNotificaciones_tbl limit _NotificacionesContador,1);
			set _ValorMinimo= (select cast(valorMinimo as decimal(18,10)) as valorMaximo from tbl_MisNotificaciones_tbl order by idNotificacion limit _NotificacionesContador,1);
			
			
			set _NotificarRecepcion=(select fn_ChequearRecepcionDatos(_DispositivosUsuariosIdDispositivoUsuario,_NotificacionesIdNotificacion));

			
			set _PromedioValorUsado=-1;
			drop temporary table if exists tblRespuesta_tbl;
			create temporary table tblRespuesta_tbl
			(
				respuesta decimal(18,10)
			);
			insert into tblRespuesta_tbl select fn_DevolverValorUsado( _DispositivosUsuariosIdDispositivoUsuario,_cantRegistrosTomar1,_NotificacionesColumna);
			set _PromedioValorUsado=(select respuesta from tblRespuesta_tbl);

			
			SET _NotificarMaximo=(select fn_ChequearValorMaximo (_DispositivosUsuariosIdDispositivoUsuario,_NotificacionesIdNotificacion,_NotificacionesColumna,_PromedioValorUsado));

			
			set _NotificarMinimo=(select fn_ChequearValorMinimo (_DispositivosUsuariosIdDispositivoUsuario,_NotificacionesIdNotificacion,_NotificacionesColumna,_PromedioValorUsado));
			
			if( _NotificarRecepcion=1 or _NotificarMaximo=1 or _NotificarMinimo=1) then
				
				CALL sp_devolverTablaCamposOrdenDispositivoUsuario(_DispositivosUsuariosIdDispositivoUsuario);

				insert into tblAvisar_tmp values(_DispositivosUsuariosIdDispositivoUsuario,_NotificacionesIdNotificacion,ltrim(rtrim(fn_CampoColumna(_DispositivosUsuariosIdDispositivoUsuario,_NotificacionesColumna))),
					case
						when _NotificarRecepcion=1 then '0'
						when _NotificarMaximo=1 then concat(_PromedioValorUsado,' >= ',_ValorMaximo)
						when _NotificarMinimo=1 then concat(_PromedioValorUsado,' <= ',_ValorMinimo)
					end,
					_NotificarMinimo,
					_NotificarMaximo,
					_NotificarRecepcion);
			end if;

			
			set _NotificacionesContador= _NotificacionesContador + 1;
		end while;
        
        INSERT INTO Notificacion_Enviada (idDispositivoUsuario,idNotificacion,campo,valor,chequearMinimo,chequearMaximo,chequearRecepcionDatos,idUsuarioContacto)
		select a.idDispositivoUsuario,a.idNotificacion,a.campo,a.valor,a.chequearMinimo,a.chequearMaximo,a.chequearRecepcionDatos,ts.idUsuario from tblAvisar_tmp a inner join vDispositivosUsuarios_SuscriptosAhora ts on a.idDispositivoUsuario=ts.idDispositivoUsuario inner join Usuario_Contacto uc on ts.idUsuario =uc.idUsuario inner join TipoNotificacion tn on uc.idTipoNotificacion=tn.id;

		INSERT INTO Accion_Realizada(idDispositivoUsuario,idAccion,s,valor,texto)
		select rn.idDispositivoUsuario,av.id,av.s,av.valor,concat(rn.campo,' ',rn.valor,' ',av.descripcion ) from (select idDispositivoUsuario,idNotificacion,Campo,valor,chequearminimo,chequearmaximo,chequearRecepciondatos	from Notificacion_Enviada where fechahora is null group by idDispositivoUsuario,idNotificacion,Campo,valor,chequearminimo,chequearmaximo,	chequearRecepciondatos	)rn inner join vAccionesVigentes av on rn.idDispositivoUsuario=av.idDispositivoUsuario and (rn.chequearMaximo=av.avisoMaximo or rn.chequearMinimo=av.avisoMinimo or rn.chequearRecepcionDatos=av.avisorecepcion);
	
		
		set _DispositivosUsuariosContador= _DispositivosUsuariosContador + 1;
	end while;
    
    
	
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
